import axios from 'axios';

const MenuEmployeeService = {
  getEmployeeData: async (searchObject) => {
    try {
      var url='http://training-api.oceantech.com.vn/cms/employees/search'
      const response = await axios.post(url,searchObject);
      return response.data;
    } catch (error) {
      console.error(error);
    }
  }
};

export default MenuEmployeeService;
